column8:
{
    "capabilities": {
        "reason_codes_enabled": true,
        "add_products_from_listing": true,
        "mixed_cart": true,
        "cash_management": true,
        "line_item_attribution": true,
        "offline_mode": true,
        "offline_mode_catalog_backup": true,
        "cash_for_endless_aisle_orders_enabled": false,
        "serialized_inventory": {
            "serial_number_regex": "^[A-Z0-9]{14}$|^[A-Z0-9]{16}$"
        },
        "printer_management": {
            "air_print": false
        },
        "send_email_receipt_from_order_history": true,
        "offline_mode_prices_backup": false,
        "ship_to_store_enabled": true
    },
    "commerce_components": {
        "warranty_lambda_url": "test",
        "gift_card_product_id": "2000081",
        "gift_card_regexp": "^((9976|9876)\\d{6,12}|(2000081))$",
        "barcode_types": [
            "CodeTypeAll",
            "UPCA"
        ],
        "document_printer_types": {
            "sales_receipt": "documentPrinter",
            "refund_note": "documentPrinter",
            "shipping_label": "documentPrinter",
            "packing_slip": "documentPrinter",
            "invoice": "documentPrinter",
            "exchange_receipt": "documentPrinter",
            "return_receipt": "documentPrinter",
            "default": "documentPrinter"
        }
    },
    "return_process_configuration": {
        "return_reasons": [
            {
                "code": 1,
                "reason": "Changed Mind",
                "reasons": {
                    "en": "Changed Mind"
                }
            },
            {
                "code": 2,
                "reason": "Wrong Size",
                "reasons": {
                    "en": "Wrong Size"
                }
            },
            {
                "code": 3,
                "reason": "Wrong Fit",
                "reasons": {
                    "en": "Wrong Fit"
                }
            }
        ],
        "quality_inspection_options": [
            {
                "code": 1,
                "option": "Sellable"
            },
            {
                "code": 2,
                "option": "damaged"
            }
        ],
        "blind_return_enabled": true
    },
    "ui_configurations": {
        "display_product_identifier": "product_id",
        "show_preorders_filter": false,
        "suggested_email_domains": [
            "gmail.com",
            "yahoo.com",
            "example.com"
        ],
        "tax_exemption_enabled": true,
        "seconds_until_logout_on_inactivity": 600,
        "use_new_om_ui": false,
        "logo": "data:image/png;base64,",
        "display_address_line_name": false
    },
    "customizations": {
        "hang_tag_printing_enabled": true,
        "gift_card_pin": true,
        "gift_receipt_printing_enabled": true,
        "membership_customers_enabled": true,
        "stage_switch_enabled": true,
        "cart_management": [
            "orderDiscount",
            "itemDiscount",
            "coupon",
            "automaticDiscount",
            "addDelivery",
            "addGiftMessage"
        ],
        "editable_extended_attributes": {
            "order": [
                {
                    "attribute_name": "gift_card_message",
                    "label": {
                        "en": "Gift Message",
                        "de": "Schreib eine Geschenknachricht",
                        "zh": "Gift Card Message, only in chinese"
                    },
                    "prompt": {
                        "en": "Write your Gift message",
                        "zh": "Write your message, only in chinese",
                        "de": "Geschenknachricht"
                    },
                    "keyboard_type": "email-address"
                }
            ]
        },
        "customization_framework": {
            "customer_extended_attributes": true
        },
        "cart_management_v2": [
            "orderDiscount",
            "itemDiscount",
            "priceOverride",
            "coupon",
            "automaticDiscount",
            "addDelivery",
            "addGiftMessage"
        ],
        "newstore_checkout_button_share_configuration": [
            "SMS",
            "EMAIL",
            "CLIPBOARD"
        ]
    },
    "release_toggles": {
        "new_customer_profile": true,
        "fiscal_printer_management_enabled": false,
        "catalog_product_quantity_picker": true,
        "new_printer_management": true,
        "drawer_navigation": true,
        "allow_multipackage_packing": true,
        "runner_enabled": true,
        "new_hang_tag_template": false,
        "bluetooth_scanner_enabled": true,
        "login_v2": true,
        "cash_rounding_enabled": true,
        "priority_orders_enabled": true,
        "new_tax_exemption": true,
        "push_notifications": true,
        "new_cash_management": true,
        "new_cash_experience": true,
        "new_cash_refund_experience": true,
        "use_short_pick_reasons": true
    },
    "external_integration": {

    }
}

